import React from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';
import { animationSlideOut, transition } from './animations';

const StartPage = () => {
    return (
            <motion.div 
                class='marquee'
                initial='out'
                animate='end'
                exit='end'
                variants={animationSlideOut}
                transition={transition}
            >
                <b>Q<span>ui</span>zz<span> A</span>pp</b>
                <Link to='/quiz'><button>Start</button></Link>
            </motion.div>
    )
}

export default StartPage;
